VALUES ('3258171831825', 'High protein muesli', 'soya flakes, speit flakes, cashew kernels, chia seeds (Salvia hispanica L.), cocoa beans pieces 5%, green raisins, sunflower seeds, date piges (date pieces 96%, separating agent: rice flour), freeze-dried banana pieces 2%, freeze-dried cranberry pieces 2%. Traces possible of: soy, sesame, gluten, nuts, peanuts. Muesli aux fèves de cacao et fruits secs Ingrédients: flocons de soja, flocons d\'épeautre, noix de cajou, graines de chia (Salvia hispanica L.), morceaux de fèves de cacao 5%, raisins verts, graines de tournesol, morceaux de dattes (morceaux de dattes 96%, agent anti-adhérent: farine de riz), morceaux de bananes lyophilisés 2%. Müsli mit Kakaobohnenstücken und gefriergetrockneten Früchten Zutaten: Sojaflocken, Dinkelflocken, Cashewkernstücke, Chiasaat (Salvia Hispanica L.), Kakaobohnenstücke 5%, Rosinen grün, Sonnenblumenkerne, Dattelstücke (Dattelstücke 96%, Trennmittel: Reismehl), Bananenstücke gefriergetrocknet 2%, Cranberrystücke gefriergetrocknet 2%. Spuren mòglich von: Soja, Sesam, Glu- ten, Nüssen, Erdnüssen. morceaux de cranberries lyophilisés 2%. Possibles traces de: soja, sésame, gluten, noisettes, cacahuètes. Muesli con chicci di cacao e frutta liofilizzata Ingredienti: fiocchi di soia, fiocchi di farro, anacardi, semi di chia (Salvia Hispanica L.), semi di cacao 5%, uvetta verde, semi di girasole, datteri (datteri 96%, agenti distaccanti: farina di riso), pezzi di banana liofilizzata pezzi di lamponi liofilizzati 2%. Possibili tracce di: soia, sesamo, glutine, noci, arachidi. con granos de cacao y fruta liofilizada Ingredientes: copos de soja, copos de espelta, anacardos, semillas de Chia (Salvia hispanica Le), granos de cacao 5%, pasas verdes, pipas de girasol, anarcardos, trozos de détiles (détiles 96%, antiaglomerante: harina de arroz), trozos de plâtano liofilizado 2%, trozos de grosellas liofilizadas 2%. Posibles trazas de: soja, sésamo, gluten, frutos secos y cacahuetes.', 'https://static.ope